import React from 'react'
import { StyleSheet, Text, View } from 'react-native'

const index = () => {
    return (
        <View style={styles.container}>
            <View style={styles.user}>
                <Text>Hello </Text>
                <Text>Salman Damanhuri</Text>
            </View>
        </View>
    )
}

export default index

const styles = StyleSheet.create({
    container : {
        display : 'flex' ,
        flexDirection : 'row' ,

    } , 

    user : {
        flexDirection : 'row'
    }
})
